import React from 'react';
import logo from './logo.svg';
import styles from './App.css';


class BtnSmall extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      theme: 'light',
      clicked: 0
    };
  }
  render() {
    return (
      <button id="{this.props.name}" className="button-small">
      </button>
    );
  }

}

function App() {
  const element = <BtnSmall name={"btnRewind"} />;
  return(element);
}
export default App;
